 **/
import java.util.Locale
import java.text.ParseException
import java.text.SimpleDateFormat
import com.github.nscala_time.time.Imports._
import scala.util.{Success, Try}

def DoubleSuccess(r :Try[Double] ) ={ 
    r match {       
        case Success(_) => true
        case _ =>  false
    }
} 

def toDouble (s : String) = {
    val result =DoubleSuccess(scala.util.Try(s.toDouble))
    if(result) s.toDouble else -1d
}

def toInt (s : String) =  {
    val result =DoubleSuccess(scala.util.Try(s.toDouble))
    if(result) s.toInt else -1.toInt
}

def toLong(s : String) =  {
    val result =DoubleSuccess(scala.util.Try(s.toDouble))
    if(result) s.toLong else -1.toLong
}

def deMarks(s : String) =  {
    s.replace("\"","").replace("[","").replace("]","")
}

def createTable(path : String, date : String) = {
    val pattern ="dd/MMM/yyyy:HH:mm:ss"  
    val format = new SimpleDateFormat(pattern,Locale.US) 

    val access_logText = sc.textFile(path)

    val access_log = access_logText.map(_.split("\"")).filter(s=> (s.length==3)).map{s=>
    val former = s(0).split(" ")
    val later = s(2).split(" ")
    val ip = former(0)
    val time = new DateTime(format.parse(former(3).replace("[","")))
    val sortByHour = time.toString("yyyy-MM-dd HH")
    val Type = s(1)
    val status = toInt(later(1))
    val requestSize = toLong(later(2))
    val responseSize = toLong(later(3))
    (ip,sortByHour,Type,status,requestSize,responseSize)

    }.toDF("ip","sortByHour","type","status","replySize","processTime")
    access_log
}

import spark.implicits._
var accesslog = Seq.empty[(String, String, String, Integer, Long, Long)].toDF("ip","sortByHour","type","status","replySize","processTime")

def addlog(path:String, date:String) ={
    val log = createTable(path, date)
    accesslog = accesslog.union(log)
    accesslog.registerTempTable("accesslog")
}

import spark.implicits._
import scala.collection._
import org.apache.spark.sql.catalyst.encoders.RowEncoder
import org.apache.spark.sql.types._
import org.apache.spark.sql.Row
import org.apache.spark.sql.{DataFrame, Row, SQLContext, DataFrameReader}
import java.sql.{Connection, DriverManager, ResultSet, Timestamp}
import com.tdunning.math.stats.TDigest


case class processTimePer(ip:String, time:String, per50:Double,per90:Double, per99:Double)
var proTimeList = mutable.MutableList[processTimePer]()

def hour(date : String)={
    date.substring(11,13).toInt
}

def dateString(date : String, delta : Int)={
    val time = hour(date)+delta
    if(time<10){
        date.substring(0,10)+" 0"+time
    }else{
        date.substring(0,10)+" "+time
    }
}

def calPerByHour(ip: String)={
    val ipData = SD200.filter(SD200("ip")=== ip).sort("sortByHour").map(row=>(row.getString(1),row.getLong(5))).collect()
    var lastTime= ipData.head._1
    var td=TDigest.createDigest(100d)
    var ipProTimeList = mutable.MutableList[processTimePer]()

    ipData.map{s=>
        if(s._1==lastTime){
            td.add(s._2.toLong)
        }else{
            ipProTimeList += processTimePer(ip,lastTime,td.quantile(0.5)/1000,td.quantile(0.9)/1000,td.quantile(0.99)/1000)
            //Consume that dates are the same, only compare the hours，supplement the lost hours
            if(hour(s._1)==0 && hour(lastTime)<23){
                 for(i<- 1 to 23-hour(lastTime)){
                    ipProTimeList += processTimePer(ip,dateString(lastTime,i),0,0,0)
                 }
            }
            if(hour(s._1)>hour(lastTime)+1){
                 for(i<- 1 until (hour(s._1)-hour(lastTime))){
                    ipProTimeList += processTimePer(ip,dateString(lastTime,i),0,0,0)
                 }
            }
            td=TDigest.createDigest(100d)
            td.add(s._2.toLong)
        }
        lastTime = s._1
    }
    ipProTimeList += processTimePer(ip,lastTime,td.quantile(0.5)/1000,td.quantile(0.9)/1000,td.quantile(0.99)/1000)
    proTimeList = proTimeList.union(ipProTimeList) 
    ipProTimeList.toDF()
}

var topIp = sqlContext.sql("select ip,sortByHour, processTime from (select * from sd200 right join ( select ip as aip, count(1) as ipsum from sd200 group by ip order by ipsum desc limit 10)a on sd200.ip = aip)b")
                        .sort("ip","sortByHour").map(r=>(r.getString(0),r.getString(1),r.getLong(2))).collect()


def calTopIp()={
    var lastTime= topIp.head._2
    var lastIP=topIp.head._1
    var td=TDigest.createDigest(100d)
    var ipProTimeList = mutable.MutableList[processTimePer]()

    topIp.map{s=>
        //judge the ip first, if ip changed, reconstructed the TDigest
        if(s._1!=lastIP){
            ipProTimeList += processTimePer(lastIP,lastTime,td.quantile(0.5)/1000,td.quantile(0.9)/1000,td.quantile(0.99)/1000)
            lastIP=s._1
            td=TDigest.createDigest(100d)
        }

        if(s._2==lastTime){
            td.add(s._3.toLong)
        }else{
            ipProTimeList += processTimePer(lastIP,lastTime,td.quantile(0.5)/1000,td.quantile(0.9)/1000,td.quantile(0.99)/1000)
            //Consume that dates are the same, only compare the hours，supplement the lost hours
            if(hour(s._2)==0 && hour(lastTime)<23){
                for(i<- 1 to 23-hour(lastTime)){
                    ipProTimeList += processTimePer(lastIP,dateString(lastTime,i),0,0,0)
                }
            }
            if(hour(s._2)>hour(lastTime)+1){
                for(i<- 1 until (hour(s._2)-hour(lastTime))){
                    ipProTimeList += processTimePer(lastIP,dateString(lastTime,i),0,0,0)
                }
            }
            td=TDigest.createDigest(100d)
            td.add(s._3.toLong)
        }
        lastTime = s._2
    }
    ipProTimeList += processTimePer(lastIP,lastTime,td.quantile(0.5)/1000,td.quantile(0.9)/1000,td.quantile(0.99)/1000)
    ipProTimeList.toDF()
}

def getTopData(n: Int)={
    val sql = "select ip,sortByHour, processTime from (select * from sd200 right join ( select ip as aip, count(1) as ipsum from sd200 group by ip order by ipsum desc limit "+n+" )a on sd200.ip = aip)b"
    topIp = sqlContext.sql(sql).sort("ip","sortByHour").map(r=>(r.getString(0),r.getString(1),r.getLong(2))).collect()
    calTopIp().registerTempTable("proTime")
    calTopIp()
}

